import React, { useContext} from "react";
import DragItem from "./DragItem";
import { Grid, GridItem } from "./Grid";
import GridContext from "./GridContext";
import Tile from "../tile.js";

function GridApp(props) {
  const {items, moveItem} = useContext(GridContext);

  return (
    <div className="GridApp">
      <Grid>
        {items.map(item => (
          <DragItem device_id={item.id} onMoveItem={moveItem}>
            <GridItem>
              <Tile device_id={item.id} device_battery={item.device_battery} appliance_name={item.appliance_name} state={item.device_state} /*timestamp={item.device.timestamp}*/ />
            </GridItem>
          </DragItem>
        ))}
      </Grid>
    </div>
  );
}

export default GridApp;
